import axios from "axios";

// The getRecipes method retrieves recipes from the server
// It accepts a "query" or term to search the recipe api for
export default {
  getGoogleBooks: function(query) {
    const myQuery = query.replace(" ", "+");
    //let test = "https://www.googleapis.com/books/v1/volumes?q=Harry+Potterintitle:keyes&key=AIzaSyBnkHRnWeGp5-PASVAVfD9k1KrPBu1WB10"
    const key = "AIzaSyBnkHRnWeGp5-PASVAVfD9k1KrPBu1WB10";
    return axios.get("https://www.googleapis.com/books/v1/volumes?q="+myQuery+"intitle:keyes&key="+key);
  }
};
